import React from "react";
import CommonButton from "../../components/common/Button";
// import {ReactComponentElement as HandLogo} from 'assets/hand.svg'
import {HandLogo} from "../../assets/HandLogo";
import './StartPage.css'
export const StartPage: React.FC=() => {
	return (
			<div className="StartPage-background">
				<div>
					<div className="greetings-container">
						<div className="Hand-container"><HandLogo /></div>
						<div className="GreetingsText-container">
							<p>Who wants to be a millionaire?</p>
							<CommonButton title='Start'/>
						</div>
					</div>
				</div>
				<div className="StartPage-splitBackground">
				</div>
			</div>
	)

}
